import React from 'react';
import Link from 'next/link';

const Navbar = () => {
  return (
    <nav>
      <menu>
        <Link>
          <a>Home</a>
        </Link>
        <Link>
          <a href="/about">About</a>
        </Link>
      </menu>
    </nav>
  );
};

export default Navbar;
